//the page/game. ex if(id1 === 2){ then "You clicked {id1} again! GAME OVER"}
//so..if an user clicked over 6 times, than you won the game!. so like const won = 6;
let OnClickHandler = (props) => {

    return (
        <div id={props.id} onClick={() => this.clickChar([])}>
        <img src="http://1.bp.blogspot.com/-uQ16l5LzkHY/Vq-Uk-8xN1I/AAAAAAAAAbQ/CII-xso3_YQ/s1600/maxresdefault.jpg" alt="Dennis" />
        <h2>Dennis</h2>
     </div> 
        )
    }

export default OnClickHandler;
